import React, {Component} from "react";

export class AddWorkout extends Component {
	state = {
		workout: {
			name: "",
			weight: 0,
			reps: 0,
			sets: 0,
		},
	};

	render() {
		return (
			<div>
				<h1>Add your workouts</h1>
				<form onSubmit={this.handleSubmit}>
					<label>Name: </label>
					<input type="text" />
					<label> Weight: </label>
					<input type="number" />
					<label> Reps: </label>
					<input type="number" />
					<label> Sets: </label>
					<input type="number" />
					<br></br>

					<input type="submit" />
				</form>
			</div>
		);
	}
}
export default AddWorkout;
